script: |
  super -f text -I q5752.spq | sort > q5752.out

inputs:
  - name: q5752.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( col2 ) NOT BETWEEN + col0 + - 2 * 37 AND - col2 * - col2 + col2;
  - name: tab2

outputs:
  - name: q5752.out
    data: |
      46	51	23
      64	77	40
      75	67	58
